define([], function () {
    /*! `json` grammar compiled for Highlight.js 11.5.0 */
    var e = (() => {
        'use strict';
        return (e) => ({
            name: 'JSON',
            contains: [
                {
                    className: 'attr',
                    begin: /"(\\.|[^\\"\r\n])*"(?=\s*:)/,
                    relevance: 1.01
                },
                {
                    match: /[{}[\],:]/,
                    className: 'punctuation',
                    relevance: 0
                },
                e.QUOTE_STRING_MODE,
                {
                    beginKeywords: 'true false null'
                },
                e.C_NUMBER_MODE,
                e.C_LINE_COMMENT_MODE,
                e.C_BLOCK_COMMENT_MODE
            ],
            illegal: '\\S'
        });
    })();
    return e;
});
